  VALUES ('kuali.atp.2015Summer1','CLUID-ENGL629-199601000000','admin',TIMESTAMP '2013-04-11 14:06:43.982','Readings pertaining to various genres of African American folklore including oral narrative, ballad, folksong, belief, custom and material culture, with special attention given to the history of the study of African American folklore including fieldwork, interpretation and the political application of these materials. Explores issues of race, ethnicity, region, gender and class, and the ongoing relations between folklore and print and other media.','Readings pertaining to various genres of African American folklore including oral narrative, ballad, folksong, belief, custom and material culture, with special attention given to the history of the study of African American folklore including fieldwork, interpretation and the political application of these materials. Explores issues of race, ethnicity, region, gender and class, and the ongoing relations between folklore and print and other media.',TIMESTAMP '2015-05-31 17:00:00','403bafd4-f71a-4811-bcdb-396134b47c8d','kuali.lui.course.offering.state.draft','kuali.lui.type.course.offering','ENGL629 CO','2a8c6e7f-a446-427e-adfd-b5a7827b5d9a','null','admin',TIMESTAMP '2013-04-11 14:06:43.982',0)
