INSERT INTO KSEN_LUI (ATP_ID,CLU_ID,CREATEID,CREATETIME,DESCR_FORMATTED,DESCR_PLAIN,EFF_DT,ID,LUI_STATE,LUI_TYPE,NAME,OBJ_ID,REF_URL,UPDATEID,UPDATETIME,VER_NBR)
  VALUES ('kuali.atp.2015Summer1','3bf6727d-0e78-4a8b-9e40-a80f0c0509d6','admin',TIMESTAMP '2013-04-11 14:06:43.982','Third semester of a three-semester calculus-based general physics course. Electrodynamics, Maxwell''s equations and electromagnetic waves, geometrical optics, interference, diffraction, special theory of relativity, and modern physics. PHYS270 and PHYS271 (lab) must be taken in the same semester and the grade for the courses will be combined into a single grade for both. To pass, students must complete passing work in both PHYS270 and PHYS271.','Third semester of a three-semester calculus-based general physics course. Electrodynamics, Maxwell''s equations and electromagnetic waves, geometrical optics, interference, diffraction, special theory of relativity, and modern physics. PHYS270 and PHYS271 (lab) must be taken in the same semester and the grade for the courses will be combined into a single grade for both. To pass, students must complete passing work in both PHYS270 and PHYS271.',TIMESTAMP '2015-05-31 17:00:00','6b29cca2-19cf-489d-90d9-be5d3dcbcc4e','kuali.lui.course.offering.state.draft','kuali.lui.type.course.offering','PHYS270 CO','fc67ba43-5f9e-4fc8-9fd2-dd3e883d8ddb','null','admin',TIMESTAMP '2013-04-11 14:06:43.982',0)
/
